import React from 'react'
//css
import './CardTable.css'
//componenets
import Card from '../Card/Card'

export default function CardTable(props) {

    return (
        <div className="CardTable">
            {
                props.info.map(item => {
                return <Card name={item.name} types={item.types} pic={item.pic}/>
                })
            }
        </div>
    )
}
